export interface Product {
    id: number;
    name: string;
    description: string;
    img: string;
}

export const products: Product[] = [
    { id: 1, name: 'Product 1', description: 'Description for product 1', img: 'Placeholder'},
    { id: 2, name: 'Product 2', description: 'Description for product 2', img: 'Placeholder'},
    { id: 3, name: 'Product 3', description: 'Description for product 3', img: 'Placeholder' },
    { id: 4, name: 'Product 4', description: 'Description for product 4', img: 'Placeholder' }
];
